import React, {Component} from "react";
import SecureTemplate from "../../common/ui/SecureTemplate/SecureTemplate";

export default class CrudMaintainView extends Component {
	constructor(props) {
		super(props);

		this.state = {
			form: {
				name: "",
				cpf: "",
				password: "",
				passwordConfirm: "",
			},
		};
	}

	async componentDidMount() {
	}

	handleSubmit = event => {

	}


	render() {
		return (
			<SecureTemplate>
				<div className="main-content">
					<div className="section__content section__content--p30">
						<div className="container-fluid">
							<div className="row text-center">
								<div className="col-md-12">
									<div className="overview-wrap">
										<h2 className="title-1">CRUD - Cadastrar</h2>
									</div>
								</div>
							</div>
							<div className="row m-t-20">
								<div className="col-lg-6">
									<label>Nome:</label>
									<input className="au-input au-input--full"
										   required={true}
										   id="name"
										   name="name"
										   value={this.state.form.name}
										   onChange={this.handleChange}
										   placeholder="Nome"/>
								</div>
								<div className="col-lg-6">
									<label>CPF:</label>
									<input className="au-input au-input--full"
										   required={true}
										   id="cpf"
										   name="cpf"
										   value={this.state.form.cpf.onlyNumbers().maskCPF()}
										   onChange={this.handleChange}
										   placeholder="Nome"/>
								</div>
							</div>
							<div className="row m-t-20">
								<div className="col-lg-6">
									<label>Email</label>
									<input className="au-input au-input--full"
										   type="email"
										   required={true}
										   id="email"
										   name="email"
										   value={this.state.form.email}
										   onChange={this.handleChange}
										   placeholder="Email"/>
								</div>
								<div className="col-lg-6">
									<label>Email Confirmacao</label>
									<input className="au-input au-input--full"
										   type="email"
										   required={true}
										   id="email"
										   name="email"
										   value={this.state.form.emailConfirm}
										   onChange={this.handleChange}
										   placeholder="Email"/>
								</div>
							</div>
							<div className="row m-t-20">
								<div className="col-lg-6">
									<label>Senha:</label>
									<input className="au-input au-input--full"
											       type="password"
											       required={true}
											       id="password"
											       name="password"
											       value={this.state.form.password}
											       onChange={this.handleChange}
											       placeholder="Senha"/>
								</div>
								<div className="col-lg-6">
									<label>Senha Confirmacao:</label>
									<input className="au-input au-input--full"
											       type="password"
											       required={true}
											       id="password"
											       name="password"
											       value={this.state.form.passwordConfirm}
											       onChange={this.handleChange}
											       placeholder="Senha"/>
								</div>
							</div>
						</div>
					</div>
				</div>
			</SecureTemplate>
		);
	}
}
